import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import * as React from 'react';

import FormInputs from './component/FormInputs';
import {
Select,
  Button,
  TextField,
 FormControl,
  Typography,
  InputLabel,
  MenuItem

} from "@mui/material";
import { textAlign } from '@mui/system';

function App() {

  const [Bank_Name, setBank_Name] = React.useState('');

  const handleChange = (event: SelectChangeEvent) => {
    setBank_Name(event.target.value);
  };

  return (<>


<React.Fragment>
      <CssBaseline />

      <Container maxWidth="sm">
        <Box sx={{
          display: "flex",
          marginTop: 2,
          boxShadow: 5,
          borderRadius: 2,
          width: 500,
          justifyContent: "center",
        }}>
         <FormControl>


         <FormControl sx={{ m: 1, minWidth: 300 }}>
          <div><h3>Loan Details</h3></div>
          </FormControl>
          <div>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
        <InputLabel id="demo-simple-select-autowidth-label">Bank Name</InputLabel>
        <Select
          // labelId="demo-simple-select-autowidth-label"
           id="demo-simple-select-autowidth"
          value={Bank_Name}
          onChange={handleChange}

          label="BankName"
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Bank</MenuItem>
          <MenuItem value={21}>Bank Two</MenuItem>
          <MenuItem value={22}>Bank Three</MenuItem>
        </Select>
      </FormControl>
    </div>

    <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField type="number" id="outlined-basic" label="Outstanding Amount" variant="outlined" />
      </FormControl>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField type="number" id="outlined-basic" label="Interest Rate " variant="outlined" />
      </FormControl>


    <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField id="outlined-basic" label="Interest Type" variant="outlined" />
      </FormControl>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField type="number" id="outlined-basic" label="Loan Type" variant="outlined" />
      </FormControl>

      <TextField id="outlined-basic" label="Term" variant="outlined" />
      <TextField id="outlined-basic" label="Properties" variant="outlined" />
      <TextField id="outlined-basic" label="Additional Securities" variant="outlined" />
      <TextField id="outlined-basic" label="is Coborrowed" variant="outlined" />
      <Button variant="contained">Submit</Button>;
      </FormControl>
      </Box>
      </Container>

    </React.Fragment>
    <div className="App">








    </div>
    </>
  );
}

export default App;
